records.addlTxt:
Defendant David Caraballo in court with attorney Enku Edgar Lin.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 6 MONTHS in the House of Correction with credit for 3
days time served.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:  
*  Possess no guns;
*  AODA assessment/treatment deemed appropriate;
*  Absolute sobriety to be monitored by random urine screens;
*  Maintain employment;
*  Perform 25 hours of community service;
*  Submit a DNA sample and pay the DNA surcharge;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.
Upon successful completion of probation, Court will grant expungement.  Notice of Right to Seek Postconviction Relief received and filed.
